      "chapo": "   Nikon 1 NIKKOR 10mm f/2.8&nbsp;(equivalent to 27mm):The most portable lens of the range was tested on a&nbsp;Nikon 1 V1:Resolution: With a score of 41lp/mm, sharpness is just average.&nbsp;Resolution is optimal at f/5.6.Distortion: Visible but very weak. (This is surprising in a positive way, given that the distortion for this kind of lens is generally stronger.)Transmission: No noticeable flaws.Vignetting: Strong at f/2.8, with a loss of up to -1.4 EV. It stabilizes at f/4, with a loss of only 1/3 EV in the corners.Chromatic aberrations: Important at f/2.8, but diminishing progressively as one closes the aperture.Nikon 1 NIKKOR",
